import HeaderAppLogo from '../../assets/investment-calculator-logo.png'
function Header() {
    return (
        <header className="header">
            <img src={HeaderAppLogo} alt="logo" />
            <h1>Investment Calculator</h1>
        </header>
    )
}

export default Header;
